import React from 'react';
import HeroInfo from './HeroInfo'
import '../styles/superhero.css';

const cardHeadings = [
    {title: 'Деятельность'}, 
    {title: 'Альтер-Эго'},
    {title: 'Друзья'},
    {title: 'Подробнее'}
]

const Superhero = (props) => {
    <React.Fragment>
        <article idName={props.id} className="hero-card">
            <h2 className="hidden">{props.name}</h2>
            <div className="hero-card__data hero-data">
                <h2 className="hero-data__title">{props.name}</h2>
                <div className="hero-data__img-box">
                    <img alt="Фото супергероя" class="hero-data__image" url={props.image} />
                </div>
                {
                    cardHeadings.map((heading) => 
                        <HeroInfo title={heading.title}/>
                    )
                }
            </div>
        </article>
    </React.Fragment>
}

export default Superhero;
